CREATE DATABASE COSTENGINE;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(80) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "last_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "tbl_additionaloption" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sku" varchar(250) NULL, "optionname" varchar(250) NULL, "optionvalue" real NULL, "markuprate" integer NULL);
CREATE TABLE IF NOT EXISTS "tbl_region" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "region" varchar(250) NULL);
CREATE TABLE IF NOT EXISTS "tbl_subcategories" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "subcategory" varchar(250) NULL, "category_id" integer NOT NULL REFERENCES "tbl_categories" ("id") DEFERRABLE INITIALLY DEFERRED, "region_id" integer NOT NULL REFERENCES "tbl_region" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tbl_subsubcategories" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "subsubcategory" varchar(250) NULL, "category_id" integer NOT NULL REFERENCES "tbl_categories" ("id") DEFERRABLE INITIALLY DEFERRED, "region_id" integer NOT NULL REFERENCES "tbl_region" ("id") DEFERRABLE INITIALLY DEFERRED, "subcategory_id" integer NOT NULL REFERENCES "tbl_subcategories" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tbl_categories" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "category" varchar(250) NULL, "region_id" integer NOT NULL REFERENCES "tbl_region" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "tbl_importsitems" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "freight" real NULL, "freightadmin" real NULL, "setupfee" real NULL, "productcost" real NULL, "baseproductsalesprice" real NULL, "totalfrieght" real NULL, "duty" real NULL, "markup" real NULL, "netduty" real NULL, "subtotal" real NULL, "forex" real NULL, "product_id" integer NOT NULL REFERENCES "tbl_importproducts" ("id") DEFERRABLE INITIALLY DEFERRED, "price" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "tbl_productoption" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sku" varchar(250) NULL, "optionname" varchar(250) NULL, "markuprate" integer NULL, "optionvalue" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "tbl_domesticproducts" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sku" varchar(250) NOT NULL UNIQUE, "productname" varchar(250) NOT NULL, "markup" integer NULL, "productcostc" real NULL, "targetgrossprofit" integer NULL, "category_id" integer NOT NULL REFERENCES "tbl_categories" ("id") DEFERRABLE INITIALLY DEFERRED, "region_id" integer NOT NULL REFERENCES "tbl_region" ("id") DEFERRABLE INITIALLY DEFERRED, "subcatagory_id" integer NULL REFERENCES "tbl_subcategories" ("id") DEFERRABLE INITIALLY DEFERRED, "subsubcategory_id" integer NULL REFERENCES "tbl_subsubcategories" ("id") DEFERRABLE INITIALLY DEFERRED, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "tbl_importproducts" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sku" varchar(250) NOT NULL UNIQUE, "productname" varchar(250) NOT NULL, "setupfee" integer NULL, "markuprate" integer NULL, "targetgrossprofit" integer NULL, "duty" integer NULL, "markup" integer NULL, "frieghtvalue" integer NULL, "forex" real NULL, "category_id" integer NOT NULL REFERENCES "tbl_categories" ("id") DEFERRABLE INITIALLY DEFERRED, "region_id" integer NOT NULL REFERENCES "tbl_region" ("id") DEFERRABLE INITIALLY DEFERRED, "subcatagory_id" integer NULL REFERENCES "tbl_subcategories" ("id") DEFERRABLE INITIALLY DEFERRED, "subsubcategory_id" integer NULL REFERENCES "tbl_subsubcategories" ("id") DEFERRABLE INITIALLY DEFERRED, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "tbl_domesticitems" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "price" real NULL, "baseproductsalesprice" real NULL, "product_id" integer NOT NULL REFERENCES "tbl_domesticproducts" ("id") DEFERRABLE INITIALLY DEFERRED, "productcost" real NULL);
CREATE TABLE IF NOT EXISTS "tbl_domesticrawitems" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NULL, "price" real NULL, "product_id" integer NOT NULL REFERENCES "tbl_domesticrawproducts" ("id") DEFERRABLE INITIALLY DEFERRED, "ldp" real NULL, "overhead" real NULL, "printval" real NULL, "totalcost" real NULL, "marketval" real NULL, "totallandedcost" real NULL, "distributorcost" real NULL, "netsellprice" real NULL, "distributor" real NULL, "distributormargin" integer NULL, "listprice" real NULL, "marginonsell" integer NULL, "onnetsell" real NULL, "markup" integer NULL);
CREATE TABLE IF NOT EXISTS "tbl_size" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "size" varchar(250) NULL);
CREATE TABLE IF NOT EXISTS "tbl_domesticsizeproducts" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sku" varchar(250) NOT NULL UNIQUE, "productname" varchar(250) NOT NULL, "markup" integer NULL, "productcostc" real NULL, "targetgrossprofit" integer NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "category_id" integer NOT NULL REFERENCES "tbl_categories" ("id") DEFERRABLE INITIALLY DEFERRED, "region_id" integer NOT NULL REFERENCES "tbl_region" ("id") DEFERRABLE INITIALLY DEFERRED, "subcatagory_id" integer NULL REFERENCES "tbl_subcategories" ("id") DEFERRABLE INITIALLY DEFERRED, "subsubcategory_id" integer NULL REFERENCES "tbl_subsubcategories" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tbl_domesticsizeitems_size" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "adddomesticsizeitem_id" integer NOT NULL REFERENCES "tbl_domesticsizeitems" ("id") DEFERRABLE INITIALLY DEFERRED, "size_id" integer NOT NULL REFERENCES "tbl_size" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tbl_sizeprice" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "SizePrice" varchar(250) NULL);
CREATE TABLE IF NOT EXISTS "tbl_domesticsizeitems" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "productcost" real NULL, "baseproductsalesprice" real NULL, "product_id" integer NOT NULL REFERENCES "tbl_domesticsizeproducts" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tbl_domesticsizeitems_price" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "adddomesticsizeitem_id" integer NOT NULL REFERENCES "tbl_domesticsizeitems" ("id") DEFERRABLE INITIALLY DEFERRED, "sizeprice_id" integer NOT NULL REFERENCES "tbl_sizeprice" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tbl_domesticrawproducts" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sku" varchar(250) NOT NULL UNIQUE, "productname" varchar(250) NOT NULL, "markup" integer NULL, "firstcost" real NULL, "category_id" integer NOT NULL REFERENCES "tbl_categories" ("id") DEFERRABLE INITIALLY DEFERRED, "region_id" integer NOT NULL REFERENCES "tbl_region" ("id") DEFERRABLE INITIALLY DEFERRED, "subcatagory_id" integer NULL REFERENCES "tbl_subcategories" ("id") DEFERRABLE INITIALLY DEFERRED, "subsubcategory_id" integer NULL REFERENCES "tbl_subsubcategories" ("id") DEFERRABLE INITIALLY DEFERRED, "overhead" real NULL, "broker" integer NULL, "duty" integer NULL, "exchage" integer NULL, "freight" integer NULL, "packing" real NULL, "printval" real NULL, "transfer" real NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "fleece" real NULL, "sewing" real NULL);
